import React from "react";

function Results(props){
    return(
        <div>
            {props.results.map((result) => {
                return(
                    <div key={result.id}>
                        <ul>
                            <li>{result.volumeInfo.title}</li>
                        </ul>
                    </div>
                )
            })}
        </div>
    )
}

export default Results;
